The summer holidays are wonderful. Dressing for them can be significantly less so: Packing light is always at a premium, but one never wants to feel high, dry, and seriously unstylish with all of the possible opportunities to pose for that most modern of vacation souvenirs, the fashionable Instagram.

<a href="http://localhost/woow/wp-content/uploads/2015/04/blog-7.jpg"><img class=" wp-image-10522 size-medium alignleft" src="http://localhost/woow/wp-content/uploads/2015/04/blog-7-300x300.jpg" alt="blog-7" width="300" height="300" /></a>

The fashion set stayed true to their roots this week, whether that be swirling around the interior of a river boat in floor-length Giambattista Valli,  la Bianca Brandolini DAdda, louchely leaning against the scenery in innately covetable summer classics in Positano, as Lisa Love did, or heading for the beach in Louis Vuitton resort denim hot pants and monogrammed Speedy in tow, as Marie-Amlie Sauv did (oh, the access!).

&nbsp;

&nbsp;

&nbsp;
<h3>Bianca Brandolini</h3>
<strong>Natasha Poly</strong> took in the ocean breeze in Formentera in a voluminous caftan, while Caroline Trentinis white tee, Vuitton skirt, and Stan Smiths in Sao Paulo were a decidedly more city-friendly take on early August style (and will certainly transition more easily into fall). And while we treasure these lazy, late summer days, falland its sartorial demandsis just around the corner: For inspiration, look no further than little North Wests latest wardrobe addition, a clutch of pint-sized Balmain blazers that will have the tot segueing into the season sans problme.

